import Link from 'next/link';
const Navbar = () => (
    <div className="menu">
        <div className="label">MENU</div>
        <div class="cpacer"></div>
                <div class="item"><li><Link href='/'><a>Home</a></Link></li></div>
                <div class="item"><li><Link href='/about'><a>About</a></Link></li></div>
                <div class="item"><li><Link href='/articles'><a>Articles</a></Link></li></div>
                <div class="item"><li><Link href='/projects'><a>Projects</a></Link></li></div>
    </div>
);

export default Navbar;
